-- Vytvoření databáze a její použití
CREATE DATABASE IF NOT EXISTS autosalon;
USE autosalon;

-- Smazání tabulek v opačném pořadí kvůli FK
DROP TABLE IF EXISTS recenze;
DROP TABLE IF EXISTS typ_auta_has_model_auta_has_barva;
DROP TABLE IF EXISTS typ_auta_has_model_auta;
DROP TABLE IF EXISTS model_auta;
DROP TABLE IF EXISTS znacka_auta;
DROP TABLE IF EXISTS typ_auta;
DROP TABLE IF EXISTS barva;

-- 1) barva
CREATE TABLE barva (
    id INT PRIMARY KEY,
    barva VARCHAR(50)
);

-- 2) typ_auta
CREATE TABLE typ_auta (
    id INT PRIMARY KEY,
    typ VARCHAR(45)
);

-- 3) znacka_auta
CREATE TABLE znacka_auta (
    id INT PRIMARY KEY,
    znacka VARCHAR(45),
    logo VARCHAR(45)
);

-- 4) model_auta
CREATE TABLE model_auta (
    id INT PRIMARY KEY,
    model VARCHAR(45),
    rok_vyroby YEAR,
    palivo VARCHAR(45),
    vykon INT,
    znacka_auta_id INT,
    FOREIGN KEY (znacka_auta_id) REFERENCES znacka_auta(id)
);

-- 5) typ_auta_has_model_auta
CREATE TABLE typ_auta_has_model_auta (
    id INT PRIMARY KEY,
    typ_auta_id INT,
    model_auta_id INT,
    obrazek VARCHAR(45),
    pocet_na_prodejine INT,
    popis TEXT,
    cena DOUBLE,
    FOREIGN KEY (typ_auta_id) REFERENCES typ_auta(id),
    FOREIGN KEY (model_auta_id) REFERENCES model_auta(id)
);

-- 6) typ_auta_has_model_auta_has_barva
CREATE TABLE typ_auta_has_model_auta_has_barva (
    typ_auta_has_model_auta_id INT,
    barva_id INT,
    FOREIGN KEY (typ_auta_has_model_auta_id) REFERENCES typ_auta_has_model_auta(id),
    FOREIGN KEY (barva_id) REFERENCES barva(id)
);

-- 7) recenze
CREATE TABLE recenze (
    id INT PRIMARY KEY,
    hodnoceni INT,
    komentar TEXT,
    datum DATE,
    typ_auta_has_model_auta_id INT,
    FOREIGN KEY (typ_auta_has_model_auta_id) REFERENCES typ_auta_has_model_auta(id)
);







